derivedColumn.description:
Returns the most recent bound period on the most recent term of this policy, i.e.
returns the {@link gw.pc.policy.period.entity.PolicyPeriod#getLatestPeriod() PolicyPeriod.getLatestPeriod()}
on a period from the term whose {@link gw.pc.policy.period.entity.PolicyTerm#isMostRecentTerm() PolicyTerm.isMostRecentTerm()}
returns <code>true</code>

Returns a {@link DateRange} starting at the {@link #getEditEffectiveDate() EditEffectiveDate} of this PolicyPeriod
and ending at the next slice.  If there is no future slice, the end date of the DateRange will be the
{@link #getPeriodEnd() PeriodEnd}

Return the Reference Date for this PolicyPeriod.  This is configurable through a call to
{@link gw.plugin.productmodel.IReferenceDatePlugin#getReferenceDateType(PolicyPeriod, Jurisdiction)}
to determine the {@link gw.pc.productmodel.typekey.ReferenceDateType}, and through a call to
{@link gw.plugin.productmodel.IReferenceDatePlugin#getPeriodReferenceDate(PolicyPeriod, gw.pc.productmodel.typekey.ReferenceDateType, gw.pl.geodata.zone.typekey.Jurisdiction)}
to lookup the actual Reference Date.
